import React, { useEffect, useState } from "react"

function Users()
{
    const [users, setUsers] = useState([])

    const fetchUserData = () => {
        fetch("https://jsonplaceholder.typicode.com/users")
        .then(response => {
            return response.json()
        })
        .then(data => {
            setUsers(data)
        })
    }

    useEffect(() => {
        fetchUserData()
    }, [])

    return(
        <>
            <h1>Users </h1>

            {users.length > 0 && (
                <ul>
                {users.map(user => (
                    <li key={user.id}>{user.name}</li>
                ))}
                </ul>
            )}
        </>
    )
}

export default Users;
